import "./App.css";
import Navigation from "./components/Navigation";
import RoomList from "./pages/ViewRooms";
import HomePage from "./components/Home"; // Import the new home page component
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Bookings from "./pages/ViewBooking";
import BookingForm from "./pages/AddBooking";
import UpdateBookingForm from "./pages/UpdateBooking";

import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import Line from "./components/Line";

function App() {
  return (
    <>
      <Router>
        <ToastContainer />

        <Routes>
          <Route exact path="/" element={<HomePage />} /> {/* Use the new home page component */}
          <Route path="/view" element={<Bookings />} />

          <Route path="/add" element={<BookingForm />} />
          <Route path="/update" element={<UpdateBookingForm />} />
          <Route path="/rooms" element={<RoomList />} /> {/* Assuming "ViewRooms" is your room listing page */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
